pub fn _get_order(dim: i8) {
    let mut x: usize = dim as usize - 1;
    let mut y: usize = dim as usize - 1;
    let directions: Vec<(i8, i8)> = vec![(1, 1), (-1, 0), (1, -1), (-1, 0)];
    let mut arr: Vec<(usize, usize)> = Vec::new();
    let mask: &[&[usize]]; 
    if dim == 21 {
        mask = &_MASK_21;
    } else {
        mask = &_MASK_25;
    }
    loop {
        if mask[y][x] == 0 {
            print!("&[{}, {}], ", y, x);
            arr.push((x, y));
        }
        let dx; let dy; let ind;
        if x < 6{
            ind = x%4;
        } else {
            ind = (x-1)%4;
        }
        (dx, dy) = directions[ind];
        let mut newx: i8 = x as i8 + dx;
        let mut newy: i8 = y as i8 + dy;
        if newy == -1 && newx == 8 {
            newy = 0;
            newx = 5;
        }
        if newy == -1 {
            newy = 0;
            newx = x as i8 - 1 ;
        }
        if newy == dim {
            if newx == 1 {
                print!("ok");
                break;
            }
            newy = dim - 1;
            newx = x as i8 - 1;
        }
        if newx == -1 {
            print!("newx is negative");
        }
        x = newx as usize;

        y = newy as usize;
    }
}

